e falló el 11 de diciembre de 2008.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:40:50','2013-06-15 10:51:22'),(853,NULL,665,NULL,7,1,'Coleccion',214,'Fecha',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-03-14',1,0,0,1,'2013-06-15 10:43:42','2013-06-15 10:43:42'),(854,NULL,666,NULL,2,1,'Coleccion',214,'Nombre',1,NULL,'Informe - Comercio Informal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:43:42','2013-06-15 10:43:42'),(855,NULL,667,NULL,3,1,'Coleccion',214,'Archivo',1,NULL,NULL,'INFORME_-_Comercio_Informal.doc','INFORME_-_Comercio_Informal.doc','pdf, PDF, jpg, Docx, docx, Doc',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:43:42','2013-06-15 10:43:42'),(856,NULL,668,NULL,1,1,'Coleccion',214,'Descripción',0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:43:42','2013-06-15 10:43:42'),(857,NULL,665,NULL,7,1,'Coleccion',215,'Fecha',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2013-03-14',1,0,0,1,'2013-06-15 10:44:37','2013-06-15 10:44:37'),(858,NULL,666,NULL,2,1,'Coleccion',215,'Nombre',1,NULL,'Informe - Estadio Pascual Guerrero',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:44:37','2013-06-15 10:44:37'),(859,NULL,667,NULL,3,1,'Coleccion',215,'Archivo',1,NULL,NULL,'INFORME_-_Estadio_2012.pdf','INFORME_-_Estadio_2012.pdf','pdf, PDF, jpg, Docx, docx, Doc',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:44:37','2013-06-15 10:44:37'),(860,NULL,668,NULL,1,1,'Coleccion',215,'Descripción',0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:44:37','2013-06-15 10:44:37'),(861,NULL,665,NULL,7,1,'Coleccion',216,'Fecha',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-03-19',1,0,0,1,'2013-06-15 10:45:18','2013-06-15 10:45:18'),(862,NULL,666,NULL,2,1,'Coleccion',216,'Nombre',1,NULL,'Informe - Investigación Mío Cable',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:45:18','2013-06-15 10:45:18'),(863,NULL,667,NULL,3,1,'Coleccion',216,'Archivo',1,NULL,