0:52:59','2013-06-15 10:52:59'),(894,NULL,670,NULL,2,1,'Coleccion',224,'Nombre',1,NULL,'Embarazos en adolescentes - Personería de Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:52:59','2013-06-15 10:52:59'),(895,NULL,671,NULL,3,1,'Coleccion',224,'Archivo',1,NULL,NULL,'INFORME_SITUACION_EMBARAZOS_EN_ADOLESCENTES_ABRIL_25.pdf','INFORME_SITUACION_EMBARAZOS_EN_ADOLESCENTES_ABRIL_25.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:52:59','2013-06-15 10:52:59'),(896,NULL,672,NULL,1,1,'Coleccion',224,'Descripción',0,'Según cifras del Departamento Administrativo Nacional de Estadísticas, Dane, y un estudio de la Fundación Restrepo Barco, Cali se ubica como la tercera ciudad con mayor número de embarazos en menores de 14 años, con un total de 262 nacimientos en el 2009. Durante el 2011, se registraron 321 niñas embarazadas, una cifra mayor que la presentada en el 2010, cuando hubo 305.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:52:59','2013-06-15 10:52:59'),(897,NULL,669,NULL,7,1,'Coleccion',225,'Fecha',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-06-26',1,0,0,1,'2013-06-15 10:53:56','2013-06-15 10:53:56'),(898,NULL,670,NULL,2,1,'Coleccion',225,'Nombre',1,NULL,'Proposición al Concejo Municipal / Código de Menor y Adolescencia',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:53:56','2013-06-15 10:53:56'),(899,NULL,671,NULL,3,1,'Coleccion',225,'Archivo',1,NULL,NULL,'proposicionalconsejomunicipalcodigomenoryadolescencia.pdf','proposicionalconsejomunicipalcodigomenoryadolescencia.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:53:56','2013-06-15 10:53:56'),(900,NULL,672,NULL,1,1,'Coleccion',225,'Descripción',0,'Defender los derechos de los niños y niñas adolescentes (NNA), a través de los mecanismos establecidos por la ley para garantizar su protección. Entre el periodo 2008 y los primeros cinco meses de 2012 se ha atendido 2.850 casos, los cuales permitieron la Restitución y Protección de Derechos a Niños, Niñas, Adolescentes, Jóvenes, Adulto Mayor y otros integrantes de la Familia. - Realizar acompañamientos en las 11 Comisarías de Familia en las audiencias por violencia intrafamiliar, regulación y fijación de cuota alimentaria. En el periodo comprendido entre el 2008 y lo primeros cinco meses del 2012, se ha realizado 576 acompañamientos a diferentes instituciones del orden municipal y nacional, como ICBF, Policía de Infancia y Adolescencia, Secretaria de Desarrollo Territorial y Bienestar Social, Secretaría de Gobierno, en casos que requerían la presencia de este ente de control, en aras de garantizar el debido proceso y la protección de niños, niñas, adolescentes y otros integrantes del grupo familiar.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:53:56','2013-06-15 10:53:56'),(901,NULL,669,NULL,7,1,'Coleccion',226,'Fecha',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-06-13',1,0,0,1,'2013-06-15 10:54:51','2013-06-15 10:54:51'),(902,NULL,670,NULL,2,1,'Coleccion',226,'Nombre',1,NULL,'Trabajo Infantil en Cali - Personería de Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:54:51','2013-06-15 10:54:51'),(903,NULL,671,NULL,3,1,'Coleccion',226,'Archivo',1,NULL,NULL,'Trabajo_infantil_en_Cali_.pdf','Trabajo_infantil_en_Cali_.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:54:51','2013-06-15 10:54:51'),(904,NULL,672,NULL,1,1,'Coleccion',226,'Descripción',0,'El presente informe es realizado con el objetivo de conocer la situación actual de los Niños, Niñas y Adolescentes trabajadores en el Municipio de Santiago de Cali, así como las diferentes opciones que se brinda para erradicar el trabajo infantil en la ciudad. Lo anterior, teniendo en cuenta que el 12 de Junio de 2012 se realizaran en todo el mundo, actividades en contra del Trabajo Infantil, fecha que se instituyo por parte de los países miembros de la Organización Internacional de Trabajo “OIT”, de la cual Colombia hace parte.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:54:51','2013-06-15 10:54:51'),(905,NULL,665,NULL,7,1,'Coleccion',227,'Fecha',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-10-17',1,0,0,1,'2013-06-15 10:56:28','2013-06-15 10:56:28'),(906,NULL,666,NULL,2,1,'Coleccion',227,'Nombre',1,NULL,'Desabastecimiento de agua potable en Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:56:29','2013-06-15 10:56:29'),(907,NULL,667,NULL,3,1,'Coleccion',227,'Archivo',1,NULL,NULL,'INFORME_-_Desabastecimiento_de_agua_potable_en_Cali.pdf','INFORME_-_Desabastecimiento_de_agua_potable_en_Cali.pdf','pdf, PDF, jpg, Docx, docx, Doc',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:56:29','2013-06-15 10:56:29'),(908,NULL,668,NULL,1,1,'Coleccion',227,'Descripción',0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:56:29','2013-06-15 10:56:29'),(909,NULL,673,NULL,7,1,'Coleccion',228,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-04-25',1,0,0,1,'2013-06-15 10:57:22','2013-06-15 10:57:22'),(910,NULL,674,NULL,2,1,'Coleccion',228,'Nombre',0,NULL,'Inundación Jarillón Río Cauca - Personería de Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:57:22','2013-06-15 10:57:22'),(911,NULL,675,NULL,3,1,'Coleccion',228,'Archivo',0,NULL,NULL,'INFORME_JARILLN_RIO_CAUCA_-_Abril_23_de_2012.pdf','INFORME_JARILLN_RIO_CAUCA_-_Abril_23_de_2012.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:57:22','2013-06-15 10:57:22'),(912,NULL,676,NULL,1,1,'Coleccion',228,'Descripción',0,'La comisión de la oficina de Derechos Humanos de la Personería de Santiago de Cali visitó, la semana pasada, el jarillón del río Cauca, a la altura de las comunas 6 y 7, al oriente de la ciudad, con el fin de conocer la situación de las personas asentadas en este sitio. Este es el presente informe que muestra los hallazgos, y resultados de la visita.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:57:22','2013-06-15 10:57:22'),(913,NULL,673,NULL,7,1,'Coleccion',229,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-04-27',1,0,0,1,'2013-06-15 10:58:21','2013-06-15 10:58:21'),(914,NULL,674,NULL,2,1,'Coleccion',229,'Nombre',0,NULL,'Invasión Espacio Público - Personería de Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:58:21','2013-06-15 10:58:21'),(915,NULL,675,NULL,3,1,'Coleccion',229,'Archivo',0,NULL,NULL,'Informe_-_Operativo_-_Personera_de_Cali.pdf','Informe_-_Operativo_-_Personera_de_Cali.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:58:21','2013-06-15 10:58:21'),(916,NULL,676,NULL,1,1,'Coleccion',229,'Descripción',0,'La ciudad de Cali se ha visto afectada por la invasión del espacio público, el funcionamiento ilegal de algunos de los establecimientos y la contaminación por el ruido, son algunos de los problemas que viven los habitantes de los sectores como: el parque del perro del barrio San Fernando, el barrio San Antonio y la carrera 66 entre calles 10 y 13, que ha puesto en jaque a la comunidad, ya que se ha venido observando la transformación que han tenido esos sectores los últimos años, puesto que el uso de suelo de un sector residencial ha pasado a ser comercial, convirtiéndose las zonas, en un enjambre de negocios de restaurantes, comidas rápidas, bares, discotecas y ventas callejeras.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:58:21','2013-06-15 10:58:21'),(917,NULL,673,NULL,7,1,'Coleccion',230,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2013-01-30',1,0,0,1,'2013-06-15 10:59:39','2013-06-15 10:59:39'),(918,NULL,674,NULL,2,1,'Coleccion',230,'Nombre',0,NULL,'Pandillas - Personería Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 10:59:39','2013-06-15 10:59:39'),(919,NULL,675,NULL,3,1,'Coleccion',230,'Archivo',0,NULL,NULL,'INFORME-PANDILLAS_PERSONERIA_.pdf','INFORME-PANDILLAS_PERSONERIA_.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 10:59:39','2013-06-15 10:59:39'),(920,NULL,676,NULL,1,1,'Coleccion',230,'Descripción',0,'La falta de inclusión social en temas de Estado de los jóvenes, asociada con la exclusión social y la reducción en la oferta de empleo, genera una ruptura social que facilita el surgimiento de conflictos de orden colectivo reflejados en el aumento acelerado en el número de pandillas. En 20 años el número de pandillas en la ciudad de Cali aumentó al pasar de 10 pandillas reconocidas en el año de 1992 a 134 pandillas para septiembre de 2012 localizadas en 17 de las 22 comunas de la ciudad, con un total de 2.134 jóvenes vinculados a estos grupos, con el objetivo de mantener el control de unas cuantas cuadras claves para los negocios ilegales. Un estudio realizado por la Personería de Cali desde la Dirección de Derechos Humanos analiza este fenómeno.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 10:59:39','2013-06-15 10:59:39'),(921,NULL,673,NULL,7,1,'Coleccion',231,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-04-08',1,0,0,1,'2013-06-15 11:00:31','2013-06-15 11:00:31'),(922,NULL,674,NULL,2,1,'Coleccion',231,'Nombre',0,NULL,'Resumen Ejecutivo Víctimas 9 de Abril',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 11:00:31','2013-06-15 11:00:31'),(923,NULL,675,NULL,3,1,'Coleccion',231,'Archivo',0,NULL,NULL,'INFORME_EJECUTIVO_VICTIMAS.pdf','INFORME_EJECUTIVO_VICTIMAS.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 11:00:31','2013-06-15 11:00:31'),(924,NULL,676,NULL,1,1,'Coleccion',231,'Descripción',0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 11:00:31','2013-06-15 11:00:31'),(925,NULL,673,NULL,7,1,'Coleccion',232,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-04-08',1,0,0,1,'2013-06-15 11:01:03','2013-06-15 11:01:03'),(926,NULL,674,NULL,2,1,'Coleccion',232,'Nombre',0,NULL,'Seminario Desaparecidos 2012 - Personería de Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 11:01:03','2013-06-15 11:01:03'),(927,NULL,675,NULL,3,1,'Coleccion',232,'Archivo',0,NULL,NULL,'SEMINARIO_DESAPARECIDOS_2012_-_OFICINA_DERECHOS_HUMANOS.pdf','SEMINARIO_DESAPARECIDOS_2012_-_OFICINA_DERECHOS_HUMANOS.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 11:01:03','2013-06-15 11:01:03'),(928,NULL,676,NULL,1,1,'Coleccion',232,'Descripción',0,'El delito de desaparición forzada constituye uno de los crímenes más graves contra la comunidad internacional, tanto así que es considerado un crimen de lesa humanidad conforme al Estatuto de Roma de 1998, para la creación de la Corte Penal Internacional. No obstante la importancia del delito en mención, tan sólo desde el año 2000, se observa su tipificación en Colombia, pese a que se reportan antecedentes de la conducta analizada, desde finales de los años 70. Desaparecer es borrar todo rastro de una persona de la faz de la tierra. Por su parte, el concepto de desaparición forzada es distante al de desaparición como mera ausencia. El primero, es una conducta punible consistente en desaparecer a una persona en contra de su voluntad para fines exclusivos de ocultamiento y negación del conocimiento del paradero de la víctima, mientras que el segundo, como su nombre lo dice, es la mera desaparición o ausencia de una persona bajo su voluntad o contra ella, pero sin el conocimiento de la ocurrencia de un hecho delictivo.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 11:01:03','2013-06-15 11:01:03'),(929,NULL,673,NULL,7,1,'Coleccion',233,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-05-09',1,0,0,1,'2013-06-15 11:01:40','2013-06-15 11:01:40'),(930,NULL,674,NULL,2,1,'Coleccion',233,'Nombre',0,NULL,'Situación Actual de la UAO - Personería de Cali',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 11:01:40','2013-06-15 11:01:40'),(931,NULL,675,NULL,3,1,'Coleccion',233,'Archivo',0,NULL,NULL,'INFORME_SITUACION_ACTUAL_UAO.pdf','INFORME_SITUACION_ACTUAL_UAO.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 11:01:40','2013-06-15 11:01:40'),(932,NULL,676,NULL,1,1,'Coleccion',233,'Descripción',0,'En este informe se pretende dar cuenta de la atención a la población desplazada y victima del conflicto armado en la ciudad de Cali, la estructura organizacional establecida para ello, las políticas públicas que orientan este trabajo y los impactos que tendrá la LEY 1448 DEL 2011 o LEY DE VÍCTIMAS Y RESTITUCIÓN DE TIERRAS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 11:01:40','2013-06-15 11:01:40'),(933,NULL,673,NULL,7,1,'Coleccion',234,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-07-12',1,0,0,1,'2013-06-15 11:03:24','2013-06-15 11:03:24'),(934,NULL,674,NULL,2,1,'Coleccion',234,'Nombre',0,NULL,'Situación HUV',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 11:03:24','2013-06-15 11:03:24'),(935,NULL,675,NULL,3,1,'Coleccion',234,'Archivo',0,NULL,NULL,'INFORME_HUV.pdf','INFORME_HUV.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 11:03:24','2013-06-15 11:03:24'),(936,NULL,676,NULL,1,1,'Coleccion',234,'Descripción',0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,0,0,1,'2013-06-15 11:03:24','2013-06-15 11:03:24'),(937,NULL,673,NULL,7,1,'Coleccion',235,'Fecha',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2012-12-09',1,0,0,1,'2013-06-15 11:05:43','2013-06-15 11:05:43'),(938,NULL,674,NULL,2,1,'Coleccion',235,'Nombre',0,NULL,'Resumen Ejecutivo Libro DDHH',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,0,0,1,'2013-06-15 11:05:43','2013-06-15 11:05:43'),(939,NULL,675,NULL,3,1,'Coleccion',235,'Archivo',0,NULL,NULL,'resumenejecutivolibroddhh.pdf','resumenejecutivolibroddhh.pdf','pdf, PDF, jpg, Docx, docx',NULL,NULL,NULL,NULL,NULL,3,0,0,1,'2013-06-15 11:05:43','2013-06-15 11:05:43'),(940,NULL,676,NULL,1,1,'Coleccion',235,'Descripción',0,'',NU