ción</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>tipos_de_campo_id</label><span>1</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>multilinea</label><span>El delito de desaparición forzada constituye uno de los crímenes más graves contra la comunidad internacional, tanto así que es considerado un crimen de lesa humanidad conforme al Estatuto de Roma de 1998, para la creación de la Corte Penal Internacional. No obstante la importancia del delito en mención, tan sólo desde el año 2000, se observa su tipificación en Colombia, pese a que se reportan antecedentes de la conducta analizada, desde finales de los años 70. Desaparecer es borrar todo rastro de una persona de la faz de la tierra. Por su parte, el concepto de desaparición forzada es distante al de desaparición como mera ausencia. El primero, es una conducta punible consistente en desaparecer a una persona en contra de su voluntad para fines exclusivos de ocultamiento y negación del conocimiento del paradero de la víctima, mientras que el segundo, como su nombre lo dice, es la mera desaparición o ausencia de una persona bajo su voluntad o contra ella, pero sin el conocimiento de la ocurrencia de un hecho delictivo.</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>model</label><span>Coleccion</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>foreign_key</label><span>232</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>usuario_id</label><span>1</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>modified</label><span>2013-06-15 11:01:03</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>created</label><span>2013-06-15 11:01:03</span><div style=\'clear:both\'></div></div><div class=\'audit-entity\'><label>id</label><span>928</span><div style=\'clear:both\'></div></div></div>',1,0,0,'2013-06-15 11:01:03'),(1493,